import React from "react";
import "./App.css";

function App() {
  const genderList = ["Male", "Female"];

  const genderHandler = (gender) => {
    console.log(gender);
  };

  return (
    <div className="App">
      <div className="selectGender">
        <h1>Select Gender</h1>
        {genderList.map((item) => {
          return (
            <button
              className="btn"
              onClick={() => {
                genderHandler(item);
              }}
            >
              {item}
            </button>
          );
        })}
      </div>
    </div>
  );
}

export default App;
